import React from "react";

function BoxChat() {
  return (
    <>
      <div className="w-2/3 h-full flex flex-col border-[1px] border-l-0 border-slate-400 rounded-tr-xl rounded-br-xl">
        <div className="w-full text-lg font-medium text-center border-b-[1px] border-slate-400 py-2">
          An Quân
        </div>
        <div className="flex-1"></div>
        <div className="relative flex justify-center mb-4">
          <input
            className="w-full border-[1px] border-slate-400 rounded-xl py-1 pr-8 outline-none mx-4"
            placeholder="Tìm kiếm liên hệ..."
          ></input>
          <div className="absolute right-6 h-full flex items-center justify-center">
            <i className="fa-solid fa-magnifying-glass text-slate-400 ml-7"></i>
          </div>
        </div>
      </div>
    </>
  );
}

export default BoxChat;
